import React from "react";

const DUMMY_DATA = [
  {
    id: e1,
    title: "some-event",
  },
  {
    id: e2,
    title: "some-event",
  },
  {
    id: e3,
    title: "some-event",
  },
  {
    id: e4,
    title: "some-event",
  },
];

export const Events = () => {
  return (
    <>
      <h1>EventsPage</h1>
      <ul>
        {DUMMY_DATA.map()}
      </ul>
    </>
  );
};
